import logo from "./logo.svg"
import "./App.js"

const Navbar = ()=>{
    return (
        <nav className="navbar navbar-expand navbar-dark bg-dark">
            <a href="" className="navbar-brand ms-1">
                <img src={logo}></img>
            </a>    
        </nav>
    )
}

export default Navbar;
